"ଚରିତ୍ର ସୀମା ଅତିକ୍ରମ ହୋଇଛି",InActiveChatSessionErrorString:"ଏହି ଚାଟ୍ ଅଧିବେଶନ ଶେଷ ହୋଇଛି। ଦୟାକରି ଏକ ନୂତନ ଅଧିବେଶନ ପାଇଁ ଏହି ଆପ୍ଲିକେସନ୍ ବନ୍ଦ କରନ୍ତୁ ଏବଂ ପୁନଃଖୋଲନ୍ତୁ।",BadTokenErrorMessage:"ଆପଣଙ୍କୁ ସାଇନ୍ ଇନ୍ କରିବାରେ ଏକ ସମସ୍ୟା ରହିଥିଲା। Copilot ପେନ୍ ବନ୍ଦ କରିବାକୁ ଏବଂ ପୁନଃ ଖୋଲିବାକୁ ଚେଷ୍ଟା କରନ୍ତୁ ଏବଂ ସାଇନ୍ ଇନ୍ କରିବାକୁ ନିର୍ଦ୍ଦେଶାବଳୀ ଅନୁସରଣ କରନ୍ତୁ।",PersonalizationSuggestionText:"ମୁଁ ମୋର Copilot ପ୍ରୋଫାଇଲ୍ ସୃଷ୍ଟି କରି ଉତ୍ତମ ପ୍ରତିକ୍ରିୟାଗୁଡିକ ପ୍ରାପ୍ତ କରିବାକୁ ଚାହୁଁଛି।",PersonalizationSuggestionResponse1:"ଆପଣ ମୋତେ କିପରି ଉତ୍ତର ଦେବାକୁ ଚାହୁଁଛନ୍ତି ସେ ସମ୍ବନ୍ଧରେ ଆପଣଙ୍କ Copilot ପ୍ରୋଫାଇଲ୍‌ ମୋତେ ଆପଣଙ୍କ ନିର୍ଦ୍ଦେଶାବଳୀ ଅନ୍ତର୍ଭୁକ୍ତ କରିବା ଉଚିତ୍‌। ଏହାକୁ ସୃଷ୍ଟି କରିବାକୁ, 'ମୋର Copilot ପ୍ରୋଫାଇଲ୍ ସୃଷ୍ଟି କରନ୍ତୁ: [ଆପଣଙ୍କ ନିର୍ଦ୍ଦେଶାବଳୀ ଅନୁସରଣ କରନ୍ତୁ]' ଟାଇପ୍ କରନ୍ତୁ।\n\n",PersonalizationSuggestionResponse2:"**ଉଦାହରଣ ସ୍ୱରୂପ।** \n\n**ମୋର Copilot ପ୍ରୋଫାଇଲ୍ ସୃଷ୍ଟି କରନ୍ତୁ: ଏକ ପ୍ରଶ୍ନର ଉତ୍ତର ଦେବା ସମୟରେ କିମ୍ବା ଏକ ଡକ୍ୟୁମେଣ୍ଟ ସଂକ୍ଷିପ୍ତ କରିବା ସମୟରେ କୀ ଲୋକ, ସଂଖ୍ୟା ଏବଂ ତାରିଖଗୁଡିକ ଅନ୍ତର୍ଭୁକ୍ତ କରନ୍ତୁ।**\n\n",PersonalizationSuggestionResponse3:"ଥରେ ଆପଣ ଆପଣଙ୍କ ପ୍ରୋଫାଇଲ୍ ସୃଷ୍ଟି କରିବା ପରେ, ମୁଁ ଆପଣଙ୍କୁ ମୋର ପ୍ରତିକ୍ରିୟାଗୁଡିକ ସଜାଡିବାକୁ ଏବଂ ବ୍ୟକ୍ତିଗତ ସାରାଂଶ ଏବଂ ଉତ୍ତରଗୁଡିକ ସୃଷ୍ଟି କରିବାକୁ ସକ୍ଷମ ହେବି। ଆପଣଙ୍କ ପ୍ରୋଫାଇଲ୍ ଅଧୁନାତନ କରିବାକୁ, 'ମୋର Copilot ପ୍ରୋଫାଇଲ୍ ଅଧୁନାତନ କରନ୍ତୁ: [ଆପଣଙ୍କ ନିର୍ଦ୍ଦେଶାବଳୀ ଅନୁସରଣ କରନ୍ତୁ]' ଟାଇପ୍ କରନ୍ତୁ। ଆପଣ ମୋତେ ସର୍ବଦା ଆପଣଙ୍କ ପ୍ରୋଫାଇଲ୍ ବିଲୋପ କରିବାକୁ କହିପାରିବେ।\n\n",PersonalizationSuggestionResponse4:"ଇନର୍ ରିଂ (ଡୋଗ୍ଫୁଡ୍) ପରିବେଶରେ Word ଏବଂ PowerPoint ରେ ଏହି ଫିଚର ଉପଲବ୍ଧ। ବୈଶିଷ୍ଟ୍ୟ କ୍ରୁକୁ ମତାମତ ପ୍ରେରଣ କରିବାକୁ ଅଙ୍ଗୁଠି ଉପର/ତଳକୁ ବ୍ୟବହାର କରନ୍ତୁ।",PromptGuideMenuItemWhatCanCopilotProfileDo:"ମୋ Copilot ପ୍ରୋଫାଇଲ୍ କ'ଣ କରିପାରିବ?",PromptGuideMenuItemCreateMyCopilotProfile:"ମୋର Copilot ପ୍ରୋଫାଇଲ୍ ସେଟ୍ କରନ୍ତୁ: [ଆପଣଙ୍କ ପ୍ରମ୍ପ୍ଟକୁ କିପରି ପ୍ରତିକ୍ରିୟା ଦେବେ ତାହା Copilot କୁ କୁହନ୍ତୁ]",PromptGuideMenuSectionCustomize:"କଷ୍ଟମାଇଜ୍ କରନ୍ତୁ",ErrorBoundaryHeader:"କିଛି ଭୁଲ ହୋଇଯାଇଛି",ErrorBoundaryBody:"ପୁନଃଚେଷ୍ଟା କରିବାକୁ ଦୟାକରି Copilot ଫଳକ ପୁନଃ ଖୋଲନ୍ତୁ।",ErrorBoundaryButton:"ସତେଜ କରନ୍ତୁ",ErrorBoundaryActionButton:"ତ୍ରୁଟି କୋଡ୍ କପି କରନ୍ତୁ",ConfirmButto